module.exports = {
  root: true,
  parser: '@typescript-eslint/parser',
  extends: [
    'eslint:recommended',
    'plugin:@typescript-eslint/recommended',
    // 'plugin:@typescript-eslint/recommended-requiring-type-checking',
    'plugin:@typescript-eslint/strict',
    'plugin:unicorn/recommended',
    'plugin:svelte/recommended',
    'plugin:svelte/prettier',
    'prettier'
  ],
  plugins: ['tailwindcss', '@typescript-eslint', 'es', 'vitest', 'no-only-tests', 'unicorn'],
  ignorePatterns: [
    'docs/*',
    '*.cjs',
    '*.js',
    '*.md',
    'snapshots.js',
    'svelte.config.js',
    'renovate.json',
    'package.json',
    'tsconfig.json'
  ],
  overrides: [
    {
      files: ['*.svelte'],
      parser: 'svelte-eslint-parser',
      parserOptions: {
        parser: '@typescript-eslint/parser'
      }
    },
    {
      files: ['*.ts'],
      extends: [
        'eslint:recommended',
        'plugin:@typescript-eslint/recommended',
        'plugin:@typescript-eslint/recommended-requiring-type-checking',
        'plugin:@typescript-eslint/strict',
        'prettier'
      ]
    }
  ],
  parserOptions: {
    sourceType: 'module',
    ecmaVersion: 2020,
    tsconfigRootDir: __dirname,
    project: './tsconfig.json',
    extraFileExtensions: ['.svelte']
  },
  env: {
    browser: true,
    es2020: true
  },
  rules: {
    '@typescript-eslint/ban-ts-comment': [
      'error',
      {
        'ts-ignore': 'allow-with-description'
      }
    ],
    '@typescript-eslint/no-unsafe-member-access': 'off',
    '@typescript-eslint/no-unsafe-assignment': 'off',
    'es/no-regexp-lookbehind-assertions': 'error',
    curly: ['error', 'all'],
    'no-only-tests/no-only-tests': 'error',
    'unicorn/no-null': 'off',
    'unicorn/filename-case': [
      'error',
      {
        case: 'camelCase'
      }
    ],
    'unicorn/filename-case': 'off',
    'unicorn/prevent-abbreviations': [
      'error',
      {
        allowList: {
          ctx: true,
          db: true,
          doc: true,
          env: true,
          fn: true,
          i: true,
          j: true,
          k: true,
          param: true,
          Props: true,
          req: true,
          res: true,
          str: true,
          searchParams: true,
          temp: true,
          ImportMetaEnv: true
        }
      }
    ]
  }
};

import { defineConfig } from 'cypress';
import fs from 'fs';
import path from 'path';
export default defineConfig({
  projectId: '2ckppp',
  viewportWidth: 1440,
  viewportHeight: 768,
  snapshotFileName: './cypress/snapshots.js',
  defaultCommandTimeout: 5000,
  requestTimeout: 5000,
  retries: {
    runMode: 2,
    openMode: 0
  },
  e2e: {
    setupNodeEvents(on, config) {
      on('task', {
        readAndDeleteFile({ fileNamePattern, folder, mode }) {
          const fileNameRegex = new RegExp(fileNamePattern);
          const files = fs.readdirSync(folder);
          const filename = files.find((file) => file.match(fileNameRegex));
          const filePath = path.join(folder, filename);
          try {
            if (mode === 'size') {
              return fs.statSync(filePath).size;
            }
            return fs.readFileSync(filePath, 'utf8');
          } finally {
            fs.rmSync(filePath);
          }
        }
      });
    },
    baseUrl: 'http://localhost:3000',
    specPattern: 'cypress/e2e/**/*.spec.ts'
  }
});

server { 
 listen 8080;
 server_name mermaid;
 location / {
   root /usr/share/nginx/html;
	 # Fallback to index.html for other paths
   try_files $uri /index.html;
 }
}

const tailwindcss = require('tailwindcss');
const autoprefixer = require('autoprefixer');
const cssnano = require('cssnano');

const mode = process.env.NODE_ENV;
const dev = mode === 'development';

module.exports = {
  plugins: [
    // Some plugins, like postcss-nested, need to run before Tailwind

    tailwindcss,

    // But others, like autoprefixer, need to run after

    autoprefixer,

    !dev &&
      cssnano({
        preset: 'default'
      })
  ]
};

{
  "extends": [
    "config:base",
    ":rebaseStalePrs",
    "group:allNonMajor",
    "schedule:earlyMondays",
    ":automergeMinor",
    ":automergeTesters",
    ":automergeLinters",
    ":automergeTypes",
    ":automergePatch"
  ],
  "packageRules": [
    {
      "matchPackagePatterns": ["^mermaid"],
      "groupName": "Mermaid packages"
    },
    {
      "matchUpdateTypes": ["minor", "patch", "pin", "digest"],
      "automerge": true
    }
  ],
  "dependencyDashboard": true,
  "major": {
    "dependencyDashboardApproval": true
  },
  "dependencyDashboardAutoclose": true
}

import preprocess from 'svelte-preprocess';
import adapter from '@sveltejs/adapter-static';

/** @type {import('@sveltejs/kit').Config} */
const config = {
  // Consult https://github.com/sveltejs/svelte-preprocess
  // for more information about preprocessors
  preprocess: [
    preprocess({
      postcss: true
    })
  ],
  kit: {
    adapter: adapter({
      pages: `docs`
    }),
    paths: process.env['DEPLOY']
      ? {
          base: `/mermaid-live-editor`
        }
      : {}
  }
};

export default config;

module.exports = {
  plugins: [require('daisyui')],
  content: ['./src/**/*.{html,js,svelte,ts}'],
  theme: {
    extend: {}
  },
  variants: {
    extend: {}
  }
};

import { sveltekit } from '@sveltejs/kit/vite';
import { svelteTesting } from '@testing-library/svelte/vite';
import { defineConfig } from 'vitest/config';

export default defineConfig({
  plugins: [sveltekit(), svelteTesting()],
  envPrefix: 'MERMAID_',
  optimizeDeps: { include: ['mermaid'] },
  server: {
    port: 3000,
    host: true
  },
  preview: {
    port: 3000,
    host: true
  },
  test: {
    environment: 'jsdom',
    // in-source testing
    includeSource: ['src/**/*.{js,ts,svelte}'],
    setupFiles: ['./src/tests/setup.ts'],
    coverage: {
      exclude: ['src/mocks', '.svelte-kit', 'src/**/*.test.ts'],
      reporter: ['text', 'json', 'html', 'lcov']
    }
  }
});
